import PerfectScrollbar from 'react-perfect-scrollbar';
import {
  Box,
  Button,
  Card,
  CardHeader,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  TableSortLabel,
  Tooltip,
  Paper,
  Grid,

} from '@mui/material';
import ArrowRightIcon from '@mui/icons-material/ArrowRight';
import { makeStyles } from "@mui/styles";
import { UseForm, Form } from "../components/UseForm";
import Controls from "../components/controls/Controls";
import Avatar from '@mui/material/Avatar';
import Select from '@mui/material/Select';
import FormControl from '@mui/material/FormControl';
import React, { useState, useEffect  } from 'react'
import axios from "axios";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import AdapterDateFns from "@mui/lab/AdapterDateFns";
import Stack from "@mui/material/Stack";
import TextField from "@mui/material/TextField";
import LocalizationProvider from "@mui/lab/LocalizationProvider";
import DatePicker from '@mui/lab/DatePicker';
import TimePicker from "@mui/lab/TimePicker";
import ParkingLotService from "../service/ParkingLotService";
import ParkingDetailService from "../service/ParkingDetailService";
import DataService from "../service/DataService";

const useStyles = makeStyles({
  pageContent: {
    margin: "40px",
    padding: "24px",
  },

});

const baseURL = "http://localhost:8080/apiv1/parkingLot/get";

  const initialFieldValues = {
    id: 0,
    numberPlate: "",
    vehicleType: "",
    location: "",
    parkingLotName: "",
    parkingDate: "",
    parkTime: "",
    parkDuration: "",

  };


export default function Bookings(props) {
  const [parkDetail, setParkDetail] = useState(initialFieldValues);
  const [selected, setSelected] = React.useState("");
  const [value, setValue] = React.useState(new Date());
  const [parkLot, setParkLot] = React.useState([]);
  const [data, setData] = React.useState(null);
  const [searchLocation, setSearchLocation] = React.useState("");
  const [locationData, setLocationData] = useState(null);
  const [parkingLotData, setParkingLotData] = useState([]);
  const [pkLot, setPkLot] = useState(null);


  useEffect(() =>{
    retrieveAllParkingLotData();
  }, [locationData, pkLot]);

  const retrieveAllParkingLotData = () =>{

    DataService.getData().then(response => {
      setData(response.data);
      console.log(response);
    }).catch(error => {
      console.log(error)
    })
  }

  const handleLocationChange = (obj) =>{
      setLocationData(obj);
      setParkingLotData(obj.lots);
  }

  const handlePkLotChange = (obj) =>{
    setPkLot(obj);
  }


    /*
     useEffect(() => {
       async function getData() {

         await axios
             .get(`http://localhost:8080/apiv1/parkingLot/get`, {
               params: "KA001"
             })
             .then((response) => {
               console.log(response.data);
               return setData(response.data);

             });
       }
     });

     */

  useEffect(() =>{
    retrieveAllParkingLots();
  }, []);

  const retrieveAllParkingLots = () =>{

    ParkingLotService.getAll().then(response => {
      setParkLot(response.data);
      console.log(response);
    }).catch(error => {
      console.log(error)
    })
  }

  const handleInputChange = e =>{

    const {name, value} = e.target
    setParkDetail({
      ...parkDetail,
      [name]: value,
    })

  }
   const handleOptionOne = e =>{
     //setSelected(e.target.value);
    /* const {value} = e.target
     setParkDetail({
       location: value
     })
     */
     const {name, value} = e.target
     setSelected(value)
     setParkDetail({
       ...parkDetail,
       [name]: value,
     })
   }
  const handleOptionTwo = e =>{

   /* const {value} = e.target
    setParkDetail({
      parkingLot: value
    })
    */
    const {name, value} = e.target
    setParkDetail({
      ...parkDetail,
      [name]: value,
    })
  }

const handleDateChange = (date) =>{
    setParkDetail({
      parkingDate: date,
    })
  }


  const handleSubmit = e =>{
    e.preventDefault()



    axios.post("http://localhost:8080/apiv1/parkingdetails/save", parkDetail)
        .then(response => {
          console.log(response)
        })
        .catch(error => {
          console.log(error)
        })

  }



  const saveParkingDetail = () =>{
    var data ={
      numberPlate: parkDetail.numberPlate,
      vehicleType: parkDetail.vehicleType,
      location: parkDetail.location,
      parkingLotName: parkDetail.parkingLotName,
      parkingDate: parkDetail.parkingDate,
      parkTime: parkDetail.parkTime,
      parkDuration: parkDetail.parkDuration,

    };
    ParkingDetailService.create(data).then(response => {
      console.log(response)
    })
        .catch(error => {
          console.log(error)
        })
  }



  function handleGetParkingLot() {
    //e.preventDefault()


    let parkingRegNo;
    axios.get(`http://localhost:8080/apiv1/parkingLot/get`, {
      params: parkingRegNo="KA001"}).then(response => {
      setParkLot(response.data);
      console.log(response.data);
    }).catch(error => {
      console.log(error)
    })

  }

  const onChangeSearchLocation = e =>{
    const searchLocation = e.target.value;
    setSearchLocation(searchLocation);
  }

  const findParkingLotByLocation = () =>{

    ParkingLotService.findByLocation(searchLocation).then(response => {
      setParkLot(response.data);
      console.log(response);
      console.log(setParkLot);
    })
        .catch(error => {
          console.log(error)
        })
  }





  const algorithm = [
    "Searching Algorithm",
    "Sorting Algorithm",
    "Graph Algorithm",
  ];
  const MOMBASAROAD = ["C++", "Java", "COOLMBS", "C#"];
  const KAREN = ["Arrays", "LinkedList", "Stack", "Queue", "KAREN CAR PARK"];


  let type = null;


  let options = null;


  if (selected === "Algorithm") {
    type = algorithm;
  } else if (selected === "MOMBASAROAD") {
    type = MOMBASAROAD;
  } else if (selected === "KAREN") {
    type = KAREN;
  }


  if (type) {
    options = type.map((el) => (<MenuItem key={el} value={el}>{el}</MenuItem>));
  }







  const classes = useStyles();
 // const { values, setValues, resetForm, handleInputChange, errors, setErrors } = UseForm(initialFieldValues, false);

    return (
      <>
      <Box
      sx={{
        display: 'flex',
        flexWrap: 'wrap',
        '& > :not(style)': {
          m: 1,
          width: '100%',
          height: '100%',
        },
      }}
    >
      <Paper elevation={3} className={classes.pageContent}>
        <Avatar /> {/*name*/}
      <Form onSubmit={saveParkingDetail}>
      <Grid container>
        <Grid item xs={6}>
          <Controls.Input
            variant="outlined"
            label="Number Plate"
            name="numberPlate"
            value={parkDetail.numberPlate}
            onChange={handleInputChange}
          />



          <FormControl fullWidth>
            <InputLabel id="demo-simple-select-label">CarType</InputLabel>
            <Select
                labelId="demo-simple-select-label"
                id="demo-simple-select-label"
                name="vehicleType"
                value={parkDetail.vehicleType}
                label="Vehicle Type"
                onChange={handleInputChange}
            >
              <MenuItem value='Saloon'>Saloon</MenuItem>
              <MenuItem value='Lorry'>Lorry</MenuItem>
              <MenuItem value='Trailer'>Trailer</MenuItem>
            </Select>
          </FormControl>





          <LocalizationProvider dateAdapter={AdapterDateFns}>
            <DatePicker
                label="Basic example"
                value={value}
                onChange={(date) => {
                  setValue(date);

                  setParkDetail({
                    ...parkDetail,
                    parkingDate : date,
                  })
                }}
                renderInput={(params) => <TextField {...params}
                name="parkingDate" value={parkDetail.parkingDate}
                />}
            />
          </LocalizationProvider>



          <LocalizationProvider dateAdapter={AdapterDateFns}>
            <TimePicker
                placeholder="Booking Time"
                value={value}
                onChange={(date) => {
                  setValue(date);

                  setParkDetail({
                    ...parkDetail,
                    parkTime : date,
                  })
                }}
                renderInput={(params) => <TextField {...params}
                    name="parkTime" value={parkDetail.parkTime}/>}
            />
          </LocalizationProvider>






        </Grid>
        <Grid item xs={6}>


          <div style={{ width: 400, marginBottom: 20 }}>
            <b>Location</b>
            <Select
                placeholder="Select Location"
                value={locationData}
                options={data}
                onChange={handleLocationChange}

            />
            <br />
            <b>Parking Lot</b>
            <Select
                placeholder="Select Parking lot"
                value={lang}
                options={langList}
                onChange={handleLanguageChange}
                getOptionLabel={x => x.name}
                getOptionValue={x => x.code}
            />
          </div>


          <FormControl fullWidth>
          <InputLabel id="dependant-dropdown">location</InputLabel>
          <Select
              labelId="dependant-dropdown"
              id="dependant-dropdown"
              name="location"
              value={parkDetail.location}
              label="Location"
              onChange={handleOptionOne}
          >
            <MenuItem value='Choose...'>Choose...</MenuItem>
            <MenuItem value='Algorithm'>Algorithm</MenuItem>
            <MenuItem value='MOMBASAROAD'>MOMBASAROAD</MenuItem>
            <MenuItem value='KAREN'>KAREN</MenuItem>
          </Select>
        </FormControl>
        <FormControl>
          <InputLabel id="dropdown">Park Lot</InputLabel>
          <Select
              labelId="dropdown"
              id="dropdown"
              name="parkingLotName"
              value={parkDetail.parkingLotName}
              label="Park Lot"
              onChange={handleOptionTwo}>{options}</Select>
        </FormControl>








          <Controls.Input
              variant="outlined"
              label="Park Duration"
              name="parkDuration"
              value={parkDetail.parkDuration}
              onChange={handleInputChange}
          />
          </Grid>
        </Grid>
        <Button variant="contained"
        fullWidth
                onClick={saveParkingDetail}
        >Submit</Button>
        </Form>
      </Paper>
      </Box>
        <Box
            sx={{
              display: 'flex',
              flexWrap: 'wrap',
              '& > :not(style)': {
                m: 1,
                width: '100%',
                height: '100%',
              },
            }}
        >

        <Form>
          <FormControl fullWidth>
            <InputLabel id="parkings">Find parking lots</InputLabel>
            <Select
                labelId="parkings"
                id="parkings"
                name="location"
                value={searchLocation}
                label="Find parking lots"
                onChange={onChangeSearchLocation}
            >
              <MenuItem value='Choose...'>Choose...</MenuItem>
              <MenuItem value='Algorithm'>Algorithm</MenuItem>
              <MenuItem value='MOMBASAROAD'>MOMBASAROAD</MenuItem>
              <MenuItem value='KAREN'>KAREN</MenuItem>
            </Select>
            <Button variant="contained"
                    fullWidth
                    onClick={findParkingLotByLocation}
            >Search</Button>
          </FormControl>



          <div align="right">
            <Button variant="contained"
                    onClick={retrieveAllParkingLots}>GetAll</Button>
          </div>

        </Form>

        <Card {...props}>
    <CardHeader title="Latest Orders" />
    <PerfectScrollbar>
      <Box sx={{ minWidth: 800 }}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>
                parkingLotId
              </TableCell>
              <TableCell>
                parkingLotName
              </TableCell>
              <TableCell>
                totalParkingSpaces
              </TableCell>
              <TableCell>
                Book
              </TableCell>

            </TableRow>
          </TableHead>
          <TableBody>
            {parkLot.map((park) =>(
                <TableRow
                hover
                key={park.parkingLotId}
                >
                  <TableCell>
                    {park.parkingLotId}
                  </TableCell>
                  <TableCell>
                    {park.parkingLotName}
                  </TableCell>
                  <TableCell>
                    {park.totalParkingSpaces}
                  </TableCell>
                  <TableCell>
                    <Button>Book</Button>
                  </TableCell>
                </TableRow>
            ))}
          </TableBody>
        </Table>
      </Box>
    </PerfectScrollbar>
    <Box
      sx={{
        display: 'flex',
        justifyContent: 'flex-end',
        p: 2
      }}
    >
      <Button
        color="primary"
        endIcon={<ArrowRightIcon fontSize="small" />}
        size="small"
        variant="text"
      >
        View all
      </Button>
    </Box>

  </Card>
        </Box>
  </>
    )
}
